import React from 'react'
import classes from './Login.module.css'
const Login = ({children, visible, setc}) => {
  return (
    <div className={[classes.Login, classes.active].join(' ')} > 
        <div className={classes.LoginContent}>
            {children} 
        </div>
    </div>
  )
}

export default Login
